import React from 'react'
import './Mobile.css'

function Mobile({isOpen, setIsOpen}) {
  return (
    <div className="mobile">
        <div className="close-icon">
        <i class="fi fi-rr-cross-circle"></i>
        </div>
    </div>
  )
}

export default Mobile
